import React from "react";
import Introduction from "./Introduction";
import Skills from "./Skills";
import Projects from "./Projects";
import Contact from "./Contact";

const Home = (props) => (
  <div>
    <Introduction />
    <Skills />
    <Projects />
    <Contact />
  </div>
);

export default Home;
